import React from "react";

const TermsOfService = () => {
  return (
    <section className="privacy">
      <h3 className="privacy__title">Impact systems Terms of Service</h3>
      <h3 className="privacy__small-title">1. Terms</h3>
      <p>
        By accessing the website at http://skyz.com, you are agreeing to be
        bound by these terms of service, all applicable laws and regulations,
        and agree that you are responsible for compliance with any applicable
        local laws. If you do not agree with any of these terms, you are
        prohibited from using or accessing this site. The materials contained in
        this website are protected by applicable copyright and trademark law.
      </p>
      <h3 className="privacy__small-title">2. Use License</h3>
      <p>
        a. Permission is granted to temporarily download one copy of the
        materials (information or software) on Impact systems' website for
        personal, non-commercial transitory viewing only. This is the grant of a
        license, not a transfer of title, and under this license you may not:
        <br />
        i. modify or copy the materials;
          </p>
    </section>
  );
};

export default TermsOfService;
